INSERT INTO `gh_field_data_field_lec_note` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_lec_note_value`, `field_lec_note_format`) VALUES
('node', 'course', 0, 46, 46, 'und', 0, 'Курс Advanced PHP буде складатися з трьох потоків - 2 з яких Symfony2 і 1 - Yii2. Перший місяць навчання буде відведено на загальні для всіх потоків теми, такі як Git, ООП, Composer, TDD. До нового року створимо простий тестовий проект. У другому півріччі будемо розділятися по командах (3-4 чоловіки) щоб виконати фінальний випускний проект.\r\n\r\nПротягом всього навчального року викладачі будуть приділяти максимум уваги тим студентам які зможуть показати свої здібності до навчання та матимуть можливість (і звичайно використовуватимуть її) працювати самостійно не менш ніж 10 год/тиждень. Для цього, раз на місяць, будуть проводитись автоматичні тестування, а також буде братися до уваги активність кожного студента на GitHub.\r\n\r\nВипускники курсу Advanced PHP мають впевнено та доцільно використовувати паттерни проектування, знати та вміти використовувати вибраний фреймворк для побудови масштабованих, тестованих сервісів з відкритим REST API.', 'filtered_html'),
('node', 'course', 0, 47, 47, 'und', 0, 'JS - незвичайна мова, тому будемо максимально концентруватись спочатку на ній, потім на инструментах розробки, в кінці - на фрейморках. Протягом курсу будуть проводитись міні-екзамени для перевірки засвоеного. Також будуть практичні уроки. На курс набирається 2 потоки, по два викладача на потік, тому кожному учню буде достатньо уваги.', 'filtered_html'),
('node', 'course', 0, 48, 48, 'und', 0, 'Курс розрахований на новачків.\r\n\r\nОднією з вимог є компютер з встановленою операційною системою OS X, віднесіться до цього відповідально, так як без нього робити на курсі вам нічого.\r\n\r\nЩо будемо вчити:\r\nКурс складається з 2х частин. 1ша - ви попарно пишете програму, яку ми вам замовляємо. 2га - ви робите випускну програму, яку самі вигадаєте. Ми дамо вам всі знання, щоб ви могли зробити 1шу. На основі другої ви або отримаєте, або не отримаєте випускний сертифікат.\r\n\r\nШлангування і поблажки - це не у нас.', 'filtered_html'),
('node', 'course', 0, 49, 49, 'und', 0, 'Курс передбачає базові знання Java або здатність швидко здобути ці знання.\r\n\r\nПротягом курсу ви розробите 3 додатка для Android. Третій додаток ви напишете попарно. На основі нього, а також випускної співбесіди буде визначено, отримаєте ви сертифікат чи ні.', 'filtered_html'),
('node', 'course', 0, 51, 51, 'und', 0, 'Команда викладачів курсу Groovy & Grails хотіла б привернути увагу людей з досвідом програмування (бажано java-stack), що хочуть вивчити новий та потужний інструмент для побудови свого проекту/стартапу. У той же час, керуючись досвідом минулого року, можна сказати, що низький поріг входження та краса :) Groovy & Grails дозволяють успішно завершити цей курс наполегливим студентам, які ще не мають бойового досвіду у програмуванні. Програма курсу дає можливість поступово освоїти Groovy та Grails. Починаючи з основи синтаксису і shell-скриптів на Groovy, і закінчуючи побудовою модульного та добре налаштованого Grails проекту. Під час курсу ми також розглянемо найкращі практики програмування та шаблони проектування (design patterns).\r\n\r\nДля проходження курсу рекомендовано:\r\n- ознайомитися з основами Java та особливостями роботи JVM\r\n- мати ноутбук, бажано з UNIX системою та вмінням управлятися з нею (Linux Mint, Ubuntu, Mac OS X і т.д.)\r\n- велике бажання та мотивація :)', 'filtered_html'),
('node', 'course', 0, 57, 57, 'und', 0, 'Групові заняття проводитимуться 1 раз в тиждень ввечері, домашнє завдання на кожен урок складатиметься з 3 частин (що вимагатиме від студента мінімум 3 рази на тиждень приділяти увагу курсам вдома).', 'filtered_html'),
('node', 'course', 0, 58, 58, 'und', 0, 'Человек может пройти курс, быть при этом программистом \\ тестером \\ проект-менеджером и т.д. Но этот человек будет иметь представление о том, с чего начинается продукт, зачем его делать, для кого, как анализировать данные, как продвигать его, как управлять продуктом, кого для этого надо поключить и т.д. Без понимания хотябы базовых вещей: целевая аудитория, рынок, конкуренты, спрос, статистических метрик, социальных сетей, как все это работает и какие бывают инструменты, мне кажется вообще разработка невозможна, ни игр, ни приложений, ни сайтов. Если говорить о продукте, а не аутсорсе.\r\n\r\nЧеловек, закончив курс, в компании может начать с тестера \\ геймдизайнера \\ QA \\ маркетолога \\ саппорта \\ аналитика статистики, неважно. Главное, чтобы у него было понимание того, чем он занимается, как может влиять на процессы и что должно получиться в конечном итоге.', 'filtered_html');
